                {friends.map((friend, index) => {
                    return <div className="text-white text-xl"key={index}> {friend}</div>
                })}

            </div>

            <div id="chats" className="mt-5 text-white text-xl h-auto border-solid border-b-2 border-black flex flex-col">Chats</div>


        </div>
    )
}



export default FriendsList;
